{"operationName":"user","variables":{},"query":"query user {
  me {
    privateMode
    id
    path
    imageUrl
    title
    displayName
    companyName
    canIModerate
    username
    location
    stackApiTrialSubscription {
      plan {
        slug
        __typename
      }
      currentPeriodEndsAt
      active
      __typename
    }
    stackApiCurrentSubscription {
      couponPercentOff
      plan {
        slug
        __typename
      }
      currentPeriodEndsAt
      active
      __typename
    }
    stackApiKey {
      apiKey
      usageLimit
      currentPeriod {
        usageCount
        periodEndsAt
        __typename
      }
      __typename
    }
    jobSearch {
      companies {
        name
        imageUrl
        slug
        __typename
      }
      tools {
        name
        imageUrl
        __typename
      }
      keywords
      location
      latitude
      longitude
      emailEnabled
      __typename
    }
    bookmarkedJobs {
      count
      edges {
        node {
          bookmarked
          id
          angellistJobUrl
          title
          location
          tools {
            id
            imageUrl
            name
            __typename
          }
          company {
            imageUrl
            name
            path
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    followedCompanies {
      count
      edges {
        node {
          id
          name
          thumbUrl
          imageUrl
          path
          __typename
        }
        __typename
      }
      __typename
    }
    stacks {
      edges {
        node {
          ...stackFields
          __typename
        }
        __typename
      }
      __typename
    }
    companies {
      id
      name
      imageUrl
      myRole
      stacks {
        ...stackFields
        __typename
      }
      __typename
    }
    decisionPrompt {
      id
      active
      message
      promptType
      selectedTool {
        id
        name
        imageUrl
        __typename
      }
      __typename
    }
    emailSettings {
      emailFeedDaily
      emailFeedWeekly
      __typename
    }
    __typename
  }
}

fragment stackFields on Stack {
  id
  imageUrl
  name
  identifier
  path
  owner {
    ... on User {
      id
      imageUrl
      username
      __typename
    }
    ... on Company {
      id
      imageUrl
      slug
      name
      __typename
    }
    __typename
  }
  __typename
}
"}
